import React from 'react';
import StudentBasicProfile from "./StudentBasicProfile";

const StudentMarksContainer = props => {
  return (
    <Grid container>
      <Grid item xs={12}>
        <StudentBasicProfile />
      </Grid>
    </Grid>
  );
}

export default StudentMarksContainer;
